import React, { Component } from 'react'

export default class logs extends Component {

    constructor(props){
        super(props);
    }

    componentDidMount = () => {

    }

    redirect = () =>{
        this.props.history.push("../")
    }

    render() {
        return (
            <div className="logs">
                <button id="searchpage" onClick={()=>this.redirect()}>Main Page</button>
                <div>
                    <table>
                        <tr>
                            <th>CLINT</th>
                            <th>METHOD</th>
                        </tr>
                    </table>
                </div>
            </div>
        )
    }
}
